// SeizureApp.tsx
import React from 'react';
import Timer from "./timer";
import './seizure.css';

// Simple Textbox component with predefined text
const Textbox: React.FC = () => {
    const predefinedText = "This is the predefined text.";

    return (
        <div className="textbox">
            <textarea readOnly value={predefinedText} />
        </div>
    );
};

const SeizureApp: React.FC = () => {
    return (
        <div className="seizure-app">
            <header>
                <h1>Seizure</h1>
            </header>
            <div className="content-container">
                <div className="left-content">
                    <Textbox />
                </div>
                <div className="right-content">
                    {/* Timer Component */}
                    <Timer />
                    {/* Big Call 911 Button */}
                    <button className="call-911-button">Call 911</button>
                </div>
            </div>
        </div>
    );
};

export default SeizureApp;
